PYTIPS2017 = lambda M, I, T: BD_TIPS_2017_PYTHON(M, I, T)[1]
PYTIPS2017_SLICE = lambda M, I, T, n=20: BD_TIPS_2017_PYTHON_SLICE(M, I, T, n)[1]
