def calculateProfileParameters(
    envdep_presets, parameters, TRANS, CALC_INFO=None, exclude=None
):
    """
    Get the Line context on the input, and return the dictionary with the "abstract" parameters.
    """
    PARAMS = {}
    for pname, pfunc in parameters:
        if exclude and pname in exclude:
            pval_default = 0
            PARAMS[
                pname
            ] = pval_default  # don't calculate parameter if it is present in exclude set
            if type(CALC_INFO) is dict:
                CALC_INFO[pname] = {"value": pval_default, "status": "excluded"}
        else:
            PARAMS[pname] = pfunc(envdep_presets, TRANS=TRANS, CALC_INFO=CALC_INFO)
    return PARAMS


